oracle.bi.tech.bootstrap = function(fOnSuccess, fOnFailure) {
   window.bitech_requirejs(['obitech-framework/jsx',
                            'ojs/ojcore',
                            'obitech-application/bootstrap',
                            'obitech-application/application',
                            'obitech-application/appserverevents',
                            'obitech-appservices/urlutils',
                            'obitech-application/bi-definitions'],
   function(jsx,
            oj,
            bootstrap,
            application,
            appserverevents,
            urlutils,
            definitions) {
      oj.Config.setResourceBaseUrl(window.bitech_requirejs.toUrl('oracle-jet'));
      var _fOnSuccess = function(){
         if(jsx.isFunction(fOnSuccess)){
            fOnSuccess();
         }
      };
     
      var _fOnFailure = function(oErr){
         if(jsx.isFunction(fOnFailure)){
            fOnFailure(oErr);
         }
      };
      
      var sBaseURL = window.bitech_bootstrap_baseUrl;
      
      var oBootstrapOptions = {};
      oBootstrapOptions.baseUrl = sBaseURL;
      oBootstrapOptions[definitions.EMBEDDED_MODE_ENABLED_PARAM_NAME] = true;
      oBootstrapOptions[definitions.EMBEDDED_MODE_MODULE_GROUP_PARAM_NAME] = window.bitech_moduleGroup;
      
      window[definitions.EMBEDDED_MODE_ENABLED_PARAM_NAME] = true;
      
      // Check for the 3legged OAuth query parameter if no security config is present      
      var oSecurityConfig = application.getSecurityConfig();
      if(jsx.isNull(oSecurityConfig)) {
         var aScripts = document.getElementsByTagName('script');
         for(var i = 0; i < aScripts.length; i++) {
            var sSrc = null;
            try {
               sSrc = aScripts[i].src;
            } catch(ex) {
               // sometimes security restricts the access to the src so just continue
               continue;
            }
            if(sSrc.indexOf("/embedding.js?") !== -1) {
               var sQueryString = sSrc.substring(sSrc.indexOf("?")+1);
               var sParamVal = urlutils.getUrlParameter(appserverevents.OAUTH_3LEGGED_URL_PARAM, sQueryString);
               if(sParamVal === "true") {
                  application.setSecurityConfig(definitions.EmbedSecurityType.OAUTH_3LEGGED);
               }
            }
         }
      }
      
      bootstrap.bootstrapApplication(_fOnSuccess, _fOnFailure, oBootstrapOptions);
   });
};

var _logger;

oracle.bi.tech.renderProject = function(oConfigJSON, fOnSuccess, fOnFailure)
{
   window.bitech_requirejs(['obitech-framework/jsx',
              'obitech-application/bootstrap',
              'obitech-application/bi-definitions',
              'obitech-framework/uif-component',
              'obitech-appservices/logger',
              'ojL10n!obitech-appservices/nls/embedding.messages'],
   function(jsx, bootstrap, definitions, uif, logger, messages) {
      if(jsx.isNull(_logger)) {
         _logger = new logger.Logger(definitions.Embedding_SERVICE_NAME);
      }
      
      var elHTMLElement = document && document.documentElement;
      var oDIRAttribute = elHTMLElement && elHTMLElement.getAttribute("dir");
      if(!oDIRAttribute || (oDIRAttribute !== "ltr" && oDIRAttribute !== "rtl")){
         _logger.warning(messages.HTML_DIR_ATTRIBUTE_MISSING);
      }
      
      var oReportOptions = {
          sInitialUseCaseType: definitions.ReportUseCaseType.REPORTING,
          hostedComponentOptions: {},
          bDisableDialogs: true,
          embeddedContentDataActionEventName: oConfigJSON.embeddedContentDataActionEventName,
          eBrushingType: !jsx.isNull(oConfigJSON.eBrushingType) ? oConfigJSON.eBrushingType : definitions.BRUSHING.AUTO
      };

      //Define the hosted component options for the Report
      oReportOptions.hostedComponentOptions[definitions.FingerPane_ID] = false;
      oReportOptions.hostedComponentOptions[definitions.ReportHeader_ID] = false;
      oReportOptions.hostedComponentOptions[definitions.DatasourceDialog_ID] = false;
      
      var fInvokeFailureCB = function(err) {
         if(jsx.isFunction(fOnFailure)) {
            try {
               fOnFailure(err);
            }
            catch(e) {
               _logger.error(e);
            }
         }
      };
      
      var _fRenderProjectOnAppAvailability = function(oApp,oReportOpts){
         var fOnEmbeddingServiceAvailability = function(oEmbeddingService){
            jsx.assertObject(oEmbeddingService,"oEmbeddingService");
            oEmbeddingService.renderProject(oConfigJSON, oReportOpts).done(function(oApp, oReportComponent) {
               if(jsx.isFunction(fOnSuccess)){
                  try {
                     fOnSuccess(oApp, oReportComponent);
                  }
                  catch(e) {
                     _logger.error(e);
                  }
               }
            }).fail(function(err) {
               fInvokeFailureCB(err);
            });
         };
         var oServiceRegistry = oApp.getService(uif.ServiceRegistry.CLASS_NAME);
         var oEmbeddingService = oServiceRegistry.getService(definitions.EmbeddingService_SERVICE_NAME);
         if(jsx.isNull(oEmbeddingService)) {
            oApp.reportSafeRequire(['obitech-appservices/embeddingservice'],function(embeddingservice){
               var oEmbeddingService = oServiceRegistry.getService(definitions.EmbeddingService_SERVICE_NAME);
               if(jsx.isNull(oEmbeddingService)) {
                  embeddingservice.attachService(oApp, fOnEmbeddingServiceAvailability, function(err){
                     // embedding service failed to load/attach
                     fInvokeFailureCB(err);
                  });
               }
               else {
                  fOnEmbeddingServiceAvailability(oEmbeddingService);
               }
            }, function(err){
               // report safe require failed
               fInvokeFailureCB(err);
            });
         }
         else {
            fOnEmbeddingServiceAvailability(oEmbeddingService);
         }
        
      };
    
      var _fOnSuccess = function(){
         var oAppInstance = bootstrap.getApplicationInstance();
         _fRenderProjectOnAppAvailability(oAppInstance,oReportOptions);
         return definitions.EmbeddingResultCodes.SUCCESS;
      };
      
      var _fOnFailure = function(oErr){
         fInvokeFailureCB(oErr);
         return definitions.EmbeddingResultCodes.FAILURE;
      };
      
      var oApp = bootstrap.getApplicationInstance();
      
      if(jsx.isNull(oApp)){
          oracle.bi.tech.bootstrap(_fOnSuccess,_fOnFailure);
      } 
      else {
         _fRenderProjectOnAppAvailability(oApp,oReportOptions);
      }     
   });
};

/**
 * Cleans up a project registered by the EmbeddingService and de-registers it from the Application
 * 
 * @param {module:obitech-application/application.Application} oApp 
 * @param {module:obitech-report/report.Report} oReportComponent 
 * @param {module:obitech-framework/bi-definitions} oDefinitions 
 */
oracle.bi.tech.cleanProject = function(oApp, oReportComponent, oDefinitions){
   var oEmbeddingService = oApp.getHostingContext().getService(oDefinitions.EmbeddingService_SERVICE_NAME);
   if(oEmbeddingService){
      oEmbeddingService.cleanProject(oApp, oReportComponent);
   }
};

oracle.bi.tech.launchProject = function(oConfigJSON)
{
   var sContextURL = window.bitech_contextUrl;
   
   var sURLPath = sContextURL + "project.jsp?reportpath=" + oConfigJSON.projectPath;
   
   window.open(sURLPath);
};

oracle.bi.tech.addFilters = function(aFilters)
{
   window.bitech_requirejs(['obitech-application/bootstrap',
              'obitech-application/bi-definitions'],
   function(bootstrap,definitions) {
      var oApp = bootstrap.getApplicationInstance();
      var oEmbeddingService = oApp.getHostingContext().getService(definitions.EmbeddingService_SERVICE_NAME);
      
      if(oEmbeddingService){
         oEmbeddingService.addFiltersToReports(aFilters);
      }      
   });
};
